import React, { useEffect } from 'react';

import GoogleButton from 'react-google-button'
function Dashboard() {
    const handleGoogleLogin = async () => {
      try {
        // Redirect to Google authentication endpoint on your backend
        window.location.href = 'http://localhost:5000/google'; // Replace with your actual endpoint
      } catch (error) {
        console.error('Error logging in with Google:', error);
      }
    };

    useEffect(() => {
      const fetchTokenFromBackend = async () => {
        try {
          const response = await fetch('http://localhost:5000/auth/google/callback');
          console.log()
          if (response.ok) {
            const data = await response.json();
            const { token } = data;
            console.log('Token received:', token);
            // Handle the received token as needed (store in state, etc.)
          } else {
            console.error('Failed to fetch token:', response.statusText);
          }
        } catch (error) {
          console.error('Error fetching token:', error);
        }
      };

      fetchTokenFromBackend();
    }, []);

    return (
      <div>
        <h1>Welcome</h1>
        <GoogleButton onClick={handleGoogleLogin}>Login with Google</GoogleButton>
      </div>
    );
  };


export default Dashboard;
